(3, 'ჩვენი უპირატესობები', '<ul>\r\n	<li><span style="font-size:22px">ამანათების ტრანსპორტირება უმოკლეს ვადებში</span></li>\r\n	<li><span style="font-size:22px">დაბალი ტარიფები</span></li>\r\n	<li><span style="font-size:22px">ნივთების გამოწერა ჩინეთიდან ყველაზე მარტივათ</span></li>\r\n	<li><span style="font-size:22px">გამოწერის ორგანიზება</span></li>\r\n	<li><span style="font-size:22px">უსაფრთხო და შეუფერხებელი სერვისი</span></li>\r\n	<li><span style="font-size:22px">ჩამოსული ამანათის საკურიერო მომსახურება</span></li>\r\n</ul>\r\n', 3, 1),
(4, 'Aliexpress.com გამოწერა', '<p><img alt="" src="http://tsexpress.ge/images/141234419776.png" /></p>\r\n\r\n<p><iframe frameborder="0" height="315" src="https://www.youtube.com/embed/Desfj-C9P-U" width="420"></iframe></p>\r\n\r\n<p>aliexpress.com არის ჩინეთში ყველაზე დიდი მაღაზია სადაც განთავსებულია ყველა სახის პროდუქცია, საიტი გათვლილია უცხოელ მომხმარებელზე,ნივთის გაგზავნა ხდება პირდაპირ მათ მისამართზე.</p>\r\n\r\n<p>საიტის წესების მიხედვით ნივთის გაგზავნა ჩინეთის მისამართიდან ჩინეთის მისამართზე აკრძალულია.</p>\r\n\r\n<p>.საქართველოში პირდაპირ ამანათის გამოგზავნისას ამანათი ჩამოდის ძალიან გვიან 40დან 60 დღემდე,ასევე არის ნივთის დაკარგვის საშიშროება.</p>\r\n\r\n<p>იმისათვის რო ნივთი გამოაგზავნინოთ&nbsp;ჩვენ საწყობში საჭიროა წინასწარ მოელაპარაკოთ გამყიდველს ჩატის მეშვეობიტ როგორც ვიდეოშია ნაჩვენები და ჩატისვე მეშვეობიტ მიაწოდოთ გამყიდველს ჩვენი საწყობის მისამართი ჩინეტში.</p>\r\n\r\n<p>თანხმობის შემთხვევაში გამყიდველი ნივთს საქართველოში გამოგზავნის ნაცვლად გააგზავნის ჩინეთში&nbsp;ჩვენ საწყობში, რის შემდეგაც ჩვენ მოვახდენთ ამანათის უმოკლეს ვადით ტრანსპორტირებას.</p>\r\n\r\n<p>კითხვების შემთხვევაში დაგვიკავშირდით ჩვენ.</p>\r\n\r\n<p style="margin-left:40px"><strong>facebook.com/tsexpress.ge</strong></p>\r\n\r\n<p style="margin-left:40px"><strong>&nbsp;(032)2192242</strong></p>\r\n\r\n<p style="margin-left:40px"><strong>&nbsp;info@tsexpress.ge</strong></p>\r\n', 2, 1),
(12, 'Alibaba.com გამოწერა', '<p><img alt="" src="http://tsexpress.ge/images/alibaba__140317181512.jpg" style="height:145px; width:500px" /></p>\r\n\r\n<p>მოგესალმებით.დღითი-დღე სულ უფრო მეტი ადამიანი გამოთქვავს&nbsp;<a href="http://www.alibaba.com/">alibaba.com</a>&nbsp;-დან ნივთების ჩამოტანის სურვილს.საიტი არის საბითო ვაჭრობისთვის განკუთვნილი.აქ ჩინეთში მოქმედი თითქმის ყველა ქარხნის და წარმოებული პროდუქციის პოვნაა შესაძლებელი.</p>\r\n\r\n<p>თუ გაწუხებთ უნდობლობა შერჩეული ქარხნის მიმართ ჩვენ დაგეხმარებით ამ პრობლემის მოგვარებაში.</p>\r\n\r\n<p>გთავაზობთ:</p>\r\n\r\n<ul>\r\n	<li>ქარხნის რეალურად არსებობის გადამოწმება.</li>\r\n	<li>ხარისხის შემოწმება.</li>\r\n	<li>შეძენა და ტრანსპროტირება საქართველოში.</li>\r\n	<li>ხარისხიანი პროდუქციის მოძება თქვენგან მოწოდებული ინფორმაციის საფუძველზე.</li>\r\n</ul>\r\n', 1, 1),
(13, 'ფასები და გადახდის მეთოდები', '<p>ამანათის ტრანპორტირება ხდება როგორც ფიზიკური პირებისთვის ასევე იურიდიული პირებისთვისაც.ამანათი ფასი განისაზღვრება ფიზიკური და მოცულობითი წონის მიხედვით თუ ამანათი დიდი ზომისაა და მას მცირე წონა აქვს ამანათი დაანგარიშდება მოცულობით.</p>\r\n\r\n<hr />\r\n<p>ფიზიკური წონა ანგარიშდება&nbsp;სასწორზე ნაჩვენები წონით და მრგვალდება 100გრამის საზუსტით</p>\r\n\r\n<p>მოცულობითი წონა ანგარიშდება. სიგრძე(სმ) X სიგანე (სმ)X სიმაღლე(სმ) / 6000 = წონა კგ</p>\r\n\r\n<hr />\r\n<p>ამანათის ტრანპორტირების თანხის გადახდა შესაძლებელია ონლაინ <strong>VISA/MASTERCARD</strong> ბარათების მეშვეობით ან საბანკო გადმორიცხვით.</p>\r\n\r\n<p><strong>ფიზიკური პირებისთვის 7,9$</strong></p>\r\n\r\n<p><strong>იურიდიული პირებისთვის 7$</strong></p>\r\n', 5, 1),
(15, 'წესები', '<p dir="ltr">1.ხელშეკრულების საგანი<br />\r\nხელშეკრულების საფუძველზე ექსპედიტორი კისრულობს თავისი სახელითა და შემკვეთის ხარჯზე განახორციელოს ტვირთის გადაზიდვასთან დაკავშირებული მოქმედებანი. შემკვეთი მოვალეა გადაიხადოს შეთანხმებული პროვიზია.<br />\r\n<br />\r\n2. მხარეები<br />\r\nხელშეკრულების მხარეები არიან ამანათების კომპანია (შპს &quot;ტრანპორტ სერვის ჯგუფი&quot;), ანუ ექსპედიტორი და მომხმარებელი, რომელიც კანონის მოთხოვნათა დაცვით გამოიწერს პროდუქციას მითითებული (www.Tsexpress.ge) ვებგვერდიდან.<br />\r\n<br />\r\n3. მომსახურების საფასური<br />\r\n3.1მომსახურების საფასურის დაანგარიშება მოხდება ტვირთის არსებული წონის ან/და მოცულობითი წონის შესაბამისად, იმის გათვალისწინებით, თუ რომელი წონა უფრო მასშტაბურია ტრანსპორტირების დროს.<br />\r\n3.2მოცულობითი წონის დაანგარიშება მოხდება ტვირთის სიგრძის, სიგანისა და სიმაღლის მიხედვით, შესაბამისი კოეფიციენტის გამოთვლის შემდგომ.<br />\r\n<br />\r\n4. ამანათის გაცემა და საფასურის გადახდა<br />\r\n4.1 ოფისიდან ამანათის გაცემა მოხდება შესაბამისი საოფისე სამუშაოს გათვალისწინებით.<br />\r\n4.2 დაუშვებელია სხვა პირზე საამანათო გზავნილის გაცემა, გარდა იმ შემთხვევისა, როდესაც ოფისი წინასწარაა ინფორმირებული აღნიშნულის თაობაზე. ასეთ შემთხვევაში ამანათის მიღებაზე უფლებამოსილი პირი ვალდებულია წარადგინოს თავისი პირადობის დამადასტურებელი საბუთი.<br />\r\n4.3 ზემოაღნიშნული მოთხოვნის შეუსრულებლობის შემთხვევაში ოფისი ვალდებულია არ უზრუნველყოს ამანათის გაცემა.<br />\r\n4.4 .მხარეთა შორის ანგარიშსწორება ხორციელდება ტვირთების ჩამოტანის შემდეგ, არაუგვიანეს 30 დღეში.<br />\r\n4.5 .სავალდებულოა გადახდა განხორციელდეს მხოლოდ www.Tsexpress.ge ვებ&ndash;გვერდზე მითითებული გადახდის მეთოდებით. სხვა შემთხვევაში თანხის მიღების დადასტურება დროულად არ მოხდება, რაც გამოიწვევს ამანათების დარიგებისას შეფერხებებს.<br />\r\n4.6კლიენტი უფლებამოსილია თბილისის საწყობიდან ტვირთი გაიტანოს 1 თვის ვადაში. აღნიშნული ვადის გასვლის შემდეგ მიიჩნევა, რომ კლიენტი თანახმაა ამანათი გადასცეს კომპანიას.<br />\r\n4. 7ანგარიშსწორება ხორციელდება ეროვნულ ვალუტაში<br />\r\n<br />\r\n<br />\r\n5. კეთილსინდისიერების მოთხოვნა ექსპედიტორისაგან<br />\r\n5.1 საწყობში დაზიანებული ამანათის მისვლის შემთხვევაში მასზე კეთდება სათანადო აღნიშვნა და ხდება მისი ფოტოგრაფირება. ამანათი უნდა იყოს სათანადოდ შეფუთული, მსხვრევადი ნივთების შემთხვევაში მასზე უნდა არსებობდეს შესაბამისი აღნიშვნა. თუკი აღნიშნული წესები არ არის დაცული მაშინ წინასწარ უნდა ვფლობდეთ ინფორმაციას საწყობში ასეთი სახის ამანათის მიღების შესახებ.<br />\r\n5.2 აღნიშნული პირობების დაუცველობის შემთხვევაში კომპანია პასუხისმგებლობას იხსნის ზიანის ანაზღაურებაზე.<br />\r\n<br />\r\n<br />\r\n6. შემკვეთის მოვალეობანი<br />\r\n6.1.ექსპედიტორის მოთხოვნით დროულად მიაწოდოს მას შესაბამისი ცნობები ტვირთის შესახებ, აგრეთვე მისცეს მითითებები, რომლებიც აუცილებელია გადაზიდვის დოკუმენტების გასაფორმებლად, მიაწოდოს აუცილებელი ცნობები საბაჟო და სხვა მოქმედებათა შესასრულებლად. გარდა ამისა, შემკვეთმა ექსპედიტორს უნდა გადასცეს აუცილებელი დოკუმენტები აღნიშნული ცნობების უტყუარობის დასადასტურებლად.<br />\r\n6.2.საფრთხეშემცველი ტვირთის არსებობისას შემკვეთმა უნდა გააფრთხილოს ექსპედიტორი საფრთხის ზუსტი სახეობის შესახებ და აუცილებლობის შემთხვევაში, მიუთითოს მას უსაფრთხოების ზომებზე.<br />\r\n6.3.ტვირთი, რომლის საფრთხეშემცველობის შესახებ არ იცოდა ექსპედიტორმა, შეიძლება ნებისმიერ დროს და ნებისმიერ ადგილას გადმოიტვირთოს, განადგურდეს ან გაუვნებელდეს ზიანის ანაზღაურების მოვალეობის დაუკისრებლად.<br />\r\n6.4.შემკვეთი ვალდებულია, თუ ამას მოითხოვს ტვირთის სახეობა, შეაფუთვინოს იგი გადაზიდვის მოთხოვნების შესაბამისად.<br />\r\n6.5.შემკვეთი ვალდებულია ამანათის მიღებამდე გადაამოწმოს ამანათის შიგთავსი. ოფისიდან გასვლის შემდეგ პროდუქციის დაზიანების შესახებ პრეტენზიები აღარ განიხილება და კომპანია არ აიღებს პასუხისმგებლობას ამანათში არსებული პროდუქციის შესაძლო დაზიანებაზე ან დანაკლისზე.<br />\r\n<br />\r\n<br />\r\n7.ექსპედიტორის პასუხისმგებლობა და ზარალის ანაზღაურება<br />\r\n7.1ექსპედიტორი ექსპედიციის ხელშეკრულებიდან გამომდინარე მოვალეობებისათვის ჩვეულებრივ მაშინ აგებს პასუხს, თუ მას ან მის დამხმარეს მიუძღვის რაიმე ბრალი. 7.2 ანაზღაურებას ექვემდებარება მხოლოდ ის ზიანი, რომელიც გამოწვეულია ამანათის დაკარგვით ან დაზიანებით, მხოლოდ მას შემდეგ რაც მოხდება საწყობისათვის მისი ჩაბარება. 7.3 ტვირთის დაზიანების ან დაკარგვის შემთხვევაში დგება საჩივარი და იწყება მოკვლევა ავიაკომპანიაში. კლიენტს ზარალი აუნაზღაურდება მხოლოდ მოკვლევის დასრულების შემდგომ. 7.4 ზარალი ანაზრაურდება მიწოდებული ინვოისის შესაბამისად. 7.5 დაზღვევის არსებობისას.მიყენებული ზარალის გამო სადაზღვევო პრემიის მისაღებად, აუცილებელია მომხმარებელმა წარმოადგინოს პროდუქციის შესყიდვის დამადასტურებელი დოკუმენტი. (დაზღვევის არსებობის შემთხვევაში)<br />\r\n7.6 მხარეთა მოქმედებით ზიანის მიყენების საფრთხის თავიდან აცილების მიზნით, კომპანია იტოვებს უფლებას თანხის სრულად ან მისი ნაწილის გადახდის გარეშე არ გამოაგზავნოს საეჭვოან ან/და 15 კგ-ზე მეტი ტვირთი.<br />\r\n<br />\r\n8.ტვირთის დაზღვევის მოვალეობა<br />\r\n8.1 ექსპედიტორს ეკისრება ტვირთის დაზღვევა მხოლოდ მაშინ, როცა ამის თაობაზე მიიღებს შემკვეთისგან მითითებას.<br />\r\n8.2.ამანათის დაზღევისთვის, საჭიროა ამანათების მართვის პანელში გააკეთოთ შესაბამისი დაზღვევის მონიშვნა. დაზღვევის მონიშვნა ან გაუქმება არ იმოქმედებს ამანათებზე, რომლებზეც ტრანსპორტირების ინვოისი უკვე გამოწერილია.<br />\r\n8.3 .დაზღვევის ღირებულება შეადგენს მომხმარებლის მიერ ამანათის დეკლარირებისას მითითებული თანხის 1%-ს. მისი გადახდა ხდება ტრანსპორტირების ინვოისთან ერთად ან დაიქვითება სადაზღვევო პრემიის მიღებისას.<br />\r\n8.4.დაზღვევა გულისხმობს ამანათის გარეგანი დაზიანების ან დაკარგვისგან დაცვას. სერვისში არ შედის ამანათში არსებული პროდუქციის შემოწმება დაზიანებაზე ან მუშაობის ვარგისიანობაზე.<br />\r\n8.5 ტექნიკური ხასიათის შეცდომის შემთხვევაში, კომპანია გაფრთხილებული უნდა იქნეს დაუყოვნებლივ (ტვირთის ჩამოსვლამდე), წინააღმდეგ შემთხვევაში ავტომატურად იხსნება ყოველგვარი პასუხისმგებლობა ექსპედიტორის მხრიდან.<br />\r\n<br />\r\n<br />\r\n9.აკრძალული ნივთები<br />\r\n9.2აღნიშნული ნივთები ამოღებულია ამანათების სიიდან და მათი ტარნსპორტირება დაუშვებელია. წინააღმდეგ შემთხვევაში, კომპანია იხსნის პასუხისმგებლობას ზიანის ანაზრაურებაზე.<br />\r\n<br />\r\n10. განბაჟება<br />\r\n10.1 კომპანიის მიერ ხდება გამარტივებული დეკლარაცია , რომელიც კომპანიის მიერ გადაეცემა დეკლარანტს იმ შემთხვევაში თუ თანხა არ აღემატება 10 000 ლარს.. ამ თანხის შემდეგ დასადგენია განბაჟებას ექვემდებარება 30 კგ-ზე მეტი 300 ლარზე მეტი ღირებულებისა და კომერციული სახის ტვირთი, რომელსაც შემოსავლების სამსახური თვითონ არჩევს ლოგიკური ეჭვის საფუძველზე.<br />\r\n10.2განსაბაჟებელი საქონლის ინვოისი მოწოდებულ უნდა იქნეს ნივთის ჩამოსვლამდე არა უგვიანეს სამი დღისა. ინვოისში მითითებულ ინფორმაციაზე პასუხისმგებლობა ეკისრება ტვირთის პატრონს. 10.3 ინვოისის არარსებობის შემთხვევაში ტვირთი გადადის შემოსავლების სამსახურის ექსპერტიზაზე და ფასდება მათი ბაზიდან ამოღებული სავარაუდო ფასის მიხედვით. 10.4 ექსპერტიზაზე გაჩერებული ტვირთი აეროპორტიდან თბილისის საწყობში მივა 10 დღის შემდეგ.<br />\r\n<br />\r\n11. დეკლარაცია<br />\r\nმომსახურების მიმღები ვალდებულია საამანათო დეკლარაციის მომზადება უზრუნველყოს ტვირთის გამოგზავნამდე 3 კალენდარული დღით ადრე. დეკლარაციაში მითითებული ინფორმაციის სისწორეზე პასუხისმგებლობა ეკისრება მომსახურების მიმღებს (კლიენტს). იმ შემთხვევაში თუ ვალდებული პირი არ შეავსებს დეკლარაციას, მისაწოდებელი საქონელი შეფერხდება საქართველოს საბაჟო ტერმინალზე.<br />\r\n<br />\r\n12. საკურიერო მომსახურება<br />\r\n12.1 საკურიერო მომსახურებაზე ინფორმაციის გაცვლა ხდება წინასწარ. საკურიერო მომსახურებას განსაზღვრავს საკურიერო კომპანია, შესაბამისად ოფისი არ არის პასუხისმგებელი საკურიერო მომსახურებისთვის გათვალისწინებული ტარიფის ცვალებადობასა და ამანათის ჩაბარების დროზე. 12.2 .კურიერს ამანათი მიაქვს მომხმარებლის მიერ სისტემაში დაფიქსირებულ მისამართზე და მხოლოდ ერთხელ.<br />\r\n12.3.ვებ&ndash;გვერდიდან მისამართის შეცვლა შესაძლებელია მხოლოდ ამანათის ჩამოსვლამდე, სხვა შემთხვევაში ამანათის გატანა შეცვლილ მისამართზე არ მოხდება.<br />\r\n12.4 .შეზღუდულია მისამართის შეცვლა და გადამისამართება ოფისში დარეკვით ან ზეპირი შეთანხმების საფუძველზე.<br />\r\n12.5 .ამანათის მისაღებად საჭიროა მომხმარებელმა თან იქონიოს მიმღების (პიროვნება, რომლის სახელი და გვარი აწერია უშუალოდ ამანათს) პირადობის დამადასტურებელი მოწმობა ან პასპორტი. ქსეროასლი არ მიიღება. იმ შემთხვევაში თუ ამანათს იბარებს სხვა, მესამე პირი, რომელიც არ არის ამანათის მიმღები, მაშინ საჭირო იქნება ასევე იმ პიროვნების პირადობის დამადასტურებელი მოწმობა ან პასპორტი ვინც უშუალოდ ჩაიბარებს ამანათს.<br />\r\n12.6 გზავნილთა ჩაბარების ვადაა: 24&ndash;დან &ndash; 72 საათი. საქართველოს მასშტაბით გზავნილთა მარშრუტი იხ. ვებ&ndash;გვერდზე ,,DHL.ge&rdquo;<br />\r\n<br />\r\n<br />\r\n13. ამანათის გამოგზავნის გრაფიკი<br />\r\n13.1ამანათები იგზავნება წინასწარ დადგენილი დროის განრიგით. მათი ტრანსპორტირების საშუალო დრო შეადგენს ამანათების გამოგზავნიდან 5-7 სამუშაო დღეს.<br />\r\n13.2 ვინაიდან ავიარეისების განრიგი არის დროში წინასწარ დადგენილი (ფიქსირებული), კომპანია პასუხისმგებლობას იხსნის ფორსმაჟორული სიტუაციებით გამოწვეული შემთხვევებისაგან, როგორიცაა რეისების გადადების ან გაუქმების გამო საამანათო გზავნილის დანიშნულების ადგილამდე ჩამოსვლის შეფერხება.<br />\r\n<br />\r\n<br />\r\n14. დამატებითი შეზღუდვები<br />\r\n14.1 წარმოდგენილი ხელშეკრულების დარღვევის შემთხვევაში კომპანია იხსნის პასუხისმგებლობას აანაზღაუროს ის ზიანი, რომელიც გამოწვეულია ამანათის მიმღები პირის მიერ ხელშეკრულების დარღვევით.<br />\r\n14.2 კომპანია პასუხს არ აგებს შეკვეთილი ნივთის ხარისხთან, ფორმასთან და ვარგისიანობასთან, ასევე სხვა ისეთ გარემოებებთან დაკავშირებით, რომელიც კლიენტს უნდა სცოდნოდა ამანათის მომწოდებელი კომპანიისაგან ხელშეკრულების დადებამდე. 14.3 მომხმარებელი ეთანხმება, რომ მის მიერ ამანათის მისაღებად წარმოდგენილი დოკუმენტები (პირადობა, პასპორტი, ბანკის ქვითარი) არის უტყუარი და ამ დოკუმენტების ნამდვილობაზე პასუხისმგებლობა მთლიანად ეკისრება მომხმარებელს.<br />\r\n14.4 . ხელშეკრულებით გათვალისწინებულ პირობებთან ერთად, მომხმარებლისა და ექსპედიტორის უფლება-მოვალეობები რეგულირდება საქართველოს მოქმედი კანონმდებლობის შესაბამისად.<br />\r\n<br />\r\n<br />\r\n15. კლიენტის პირადი ინფორმაცია<br />\r\n15.1 კლიენტის პირადი ინფორმაცია წარმოადგენს კონფიდენციალურ ინფორმაციას და ინახება კომპანიის კლიენტთა მომსახურების ბაზაში. კომპანია სრულადაა პასუხისმგებელი ზემოაღნიშნული ინფორმაციის დაცვაზე.<br />\r\n15.2 იმ შემთხვევაში თუ მომხმარებლის პირადი ინფორმაცია ბაზაში არასწორადაა დაფიქსირებული, აღნიშნულის თაობაზე პასუხისმგებლობა ეკისრება ბაზის რეგისტრატორს.<br />\r\n<br />\r\nმადლობას გიხდით თანამშრომლობისთვის</p>\r\n', 4, 1);
