(18, 'როგორ გამოვწერო', 1, 1, '<p>ყურადღება: თუ ვერ ახერხებთ ნივთის საფასურის გადახდას გადახდის სისტემის არქონის ან სხვა მიზეზების გამო შეგიძლიათ მოგვმართოთ ჩვენ.<br />\r\n<br />\r\nთუ გამოწერას ვერ ახერხებთ და გინდათ დახმარება ან თანხის გადახდა(Paypal) ჩვენი საკომისიო&nbsp;50$-მდე შეკვეთებზე შეადგენს ფიქსირებულ&nbsp;5$-ს<br />\r\n50$-ის ზევით გადასახდელი თანხის&nbsp;10%-ს.<br />\r\n<br />\r\n<br />\r\n*გაითველისწინეთ ჩვენი დახმარებით გამოწერილ ნივთის ხარისხზე,ზომაზე და ფერზე პასუხისმგებლები არ ვართ.ჩვენ მხოლოდ თქვენი შეკვეთის გამოწერაში გეხმარებით.<br />\r\n<br />\r\nშეგიძლიათ იხილოთ საიტის ინგლისური ვერსიაც&nbsp;<a href="http://rutaobao.com/" target="_blank">rutaobao.com</a>&nbsp;სადაც გადახდა შესაძლებელია პლასტიკური ბარათითაც<br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352722166_taobao_marketplace.jpg" title="" /><br />\r\n<br />\r\n<strong>წარმოგიდგენთ ყველაზე დიდ ჩინურ ონლაინ მაღაზიას&nbsp;<a href="http://taobao.com/" target="_blank">taobao.com</a></strong><br />\r\n<br />\r\nმაღაზიაში შეიძლება უამრავი სახის პროდუქციის შეძენა ტანსაცმელიდან დაწყებული ტექნიკით დამთავრებული.<br />\r\nეს მაღაზია სხვა მაღაზიებისგან გამოირჩევა დაბალი ფასით და დიდი არჩევანით.მსგავს პროდუქციას ხშირად წააწყდებით ამერიკულ ინტერნეტ მაღაზიებში.<br />\r\n<br />\r\nერთადერთი დაბრკოლება არის ის,რომ საიტი მხოლოდ ჩინურ საგადახდო სისტემას იღებს ამიტომ უნდა გამოვიყენოთ აგენტური სისტემები.<br />\r\n<br />\r\n<a href="http://track.ge/uploads/posts/2012-11/1352722549_bhiner_logo.png"><img alt="" src="http://track.ge/uploads/posts/2012-11/thumbs/1352722549_bhiner_logo.png" title="" /></a><br />\r\n<br />\r\n<strong>ერთერთი მათგანია&nbsp;<a href="http://bhiner.com/" target="_blank">Bhiner.com</a></strong><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727476_horizontal_solution_global_hk.gif" title="" /><br />\r\n<br />\r\nსაიტზე შესაძლებელია როგორც განთავსებული პროდუქციის შეძენა, ასევე თქვენს მიერ მოიძიებული პროდუქტის გამოწერაც.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>1.გავდივართ&nbsp;<a href="http://www.bhiner.com/member.php?mode=register&amp;token=newMember" target="_blank">რეგისტრაციას</a></strong><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352724455_b.png" title="" /><br />\r\n<br />\r\n2.ვარჩევთ ნივთს გამოსაწერად<br />\r\n<br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352725257_buy.jpg" title="" /><br />\r\n<br />\r\nგამყიდველების რეიტინგი შეგიძლიათ იხილოთ&nbsp;<a href="http://www.bhiner.com/taobao-seller-lv" target="_blank">აქ</a><br />\r\n<br />\r\n<strong>3.ვაგდებთ კალათაში და ვამზადებთ გამოსაწერად</strong><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727161_23.png" title="" /><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727165_24.png" title="" /><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727170_26.png" title="" /><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727322_ship.jpg" title="" /><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727202_gadaxda.jpg" title="" /><br />\r\n<br />\r\n<img alt="" src="http://track.ge/uploads/posts/2012-11/1352727264_paypal.jpg" title="" /><br />\r\n<br />\r\n<br />\r\nდამატებითი ინფრომაცია და ვიდეო გაკვეთილი შეგიძლიათ იხილოთ&nbsp;<a href="http://www.bhiner.com/tutorial" target="_blank">აქ</a>&nbsp;</p>\r\n'),
