(20, 'კომპანიის შესახებ', 3, 1, '<p>შპს&nbsp;&ldquo;თიეს ექსპრესი&ldquo;გთავაზობთ&nbsp;ამანათების ჩინეთიდან გამოწერის&nbsp;</p>\r\n\r\n<p>&nbsp;ეფექტურ&nbsp;და&nbsp;სწრაფ&nbsp;მომსახურებას მისაღებ&nbsp;ფასად.&nbsp;</p>\r\n\r\n<p>&nbsp;კომპანია &bdquo;თიეს ექსპრესი&ldquo; შეიქმნა საერთაშორისო გადამზიდავი კომპანიის &bdquo;ტრანსპორტ&nbsp;</p>\r\n\r\n<p>სერვის ჯგუფის&ldquo; გამოცდილი გუნდის მიერ. ჩვენი გუნდი&nbsp;</p>\r\n\r\n<p>ტრანსპორტირების&nbsp;სფეროში1994&nbsp;წლიდან მოღვაწეობს&nbsp;და&nbsp;</p>\r\n\r\n<p>გამოვირჩევით&nbsp;გამოცდილებით</p>\r\n\r\n<p>გთავაზობთ გამოწერის &nbsp;მარტივ ხერხს ჩვენი საიტის მეშვეობით - &nbsp;თქვენს მიერ&nbsp;</p>\r\n\r\n<p>შეძენილი ნივთი, მივა ჩინეთში, ჩვენს საწყობში - თქვენს მისამართზე და ამის შემდგომ&nbsp;</p>\r\n\r\n<p>ჩვენი აგენტი ჩინეთში უზრუნველყოფს ნივთის საჰაერო ტრანსპორტირებას&nbsp;</p>\r\n\r\n<p>თბილისამდე.</p>\r\n\r\n<p>ჩვენი უპირატესობაა - ზრუნვა თქვენი ნივთის უსაფრთხო და სრაფ ტრანსპორტირებაზე.</p>\r\n'),
(21, 'კითხვა/პასუხი', 5, 1, '<p><em><strong>როგორ უნდა მივიღო მისამართი ჩინეთში?</strong></em></p>\r\n\r\n<p>ჩინური საწყობის მისამართის მისაღებად საჭიროა გაიაროთ რეგისტრაცია ჩვენს საიტზე.შეავსოთ ყველა ველი და თქვენ კაბილეთში დაგენერირდება თქვენი მისამართიც</p>\r\n\r\n<p><em><strong>როგორ უნდა ჩავწერო საიტზე ჩემი მისამართი?</strong></em></p>\r\n\r\n<p>მისამართი უნდა შეავსოთ იმ ფორმით რა ფორმითაც მოცემულია თქვენ კაბინეტში.უმჯობესია იყოს ჩინურ ენაზე.თუ გამოუვალი სიტუაციაა ინგლისურადაც შეგიძლიათ ჩაწეროთ</p>\r\n\r\n<p><em><strong>რამდენ ხანში ჩამოდის ტვირთი? </strong></em></p>\r\n\r\n<p>კვირაში იგეგმება ერთი რეისი.ჩამოდის გამოფრენიდან 7 დღეში თუ ჩვენგან დამოუკიდებელი მიზეზების გამო ავიახაზებს არ შეექმნება პრობლემები</p>\r\n\r\n<p><em><strong>რა ჯდება ტვირთის ტრანსპორტირება?</strong></em></p>\r\n\r\n<p>ერთი კილოგრამის ტრანსპორტირების ფასი 7,9$ იურიდიული 7$</p>\r\n\r\n<p><em><strong>ჩემი ამანათი იმაზე მეტს იწონის ვიდრე საიტზე იყო მითითებული.რატომ? </strong></em></p>\r\n\r\n<p>ზოგიერთ საიტზე მითითებულია მიახლოებითი წონა.ეს წონა ამანათის ფასის წინასწარ დასაანგარიშებლად არ გამოდგება.იმ შემთხვევაში თუ ფიზიკურ წონაზე(რასაც სასწორი აჩვენებს) მეტია მოცულობითი წონა(ფუთის ან ყუთის მოცულობა) მაშინ დასაანგარიშებლად აიღება მოცულობითი წონა.თუ გადაწონვას მოისურვებთ ოფისში შეგვიძლია თავიდან აგიწონოთ თქვენი ამანათი</p>\r\n\r\n<p><em><strong>როგორ ხდება ჩამოსული ამანათის გატანა? </strong></em></p>\r\n\r\n<p>ჩამოსული ამანათების გატანა შესაძლებელია მისამართიდან:ბახტრიონის 10 (იხილეთ კონტაქტში რუქაზე).სამუშაო საათები 11სთ 19სთ. ტ:555-13-72-14; 557-56-83-23.&nbsp;გატანამდე ამანათის ღირებულების გადახდა აუცილებელია როგორ გადავიხადო? გადახდა შესაძლებელია თიბისი&nbsp;ბანკიდან ანგარიშზე მიმღები ბანკი:თიბისი ბანკი ანგარიშის ნომერი:GE09TB7993436070100002&nbsp;ბანკის კოდი:&nbsp;მიმღები:შპსTBCBGE22 TSEXPRESS.GE&nbsp;საიდენფიკაციო კოდი:430030012 დანიშნულებაში მიუთითეთ სახელი გვარი და ოთახის ნომერი TSG****</p>\r\n\r\n<p><em><strong>ამანათი არ მიჩანს ოთახში.როგორ მოვიქცე?</strong></em></p>\r\n\r\n<p>პირველ რიგში გადაამოწმეთ თვითონ გამყიდველთან გამოგზავნილია თუ არა ამანათი და მისი სტატუსი.ამის შემდეგ მოგვმართეთ ჩვენ თრექინგ კოდით რათა საწყობში გადავამოწმოთ.</p>\r\n\r\n<p><em><strong>რა შემთხვევაში მიწევს განბაჟების გაკეთება?</strong></em></p>\r\n\r\n<p>განბაჟებას ექვემდებარება ყველა ტვირთი რომელიც არის 300 ლარზე მეტი ღირებულების ან 30კგ-ზე მეტი წონის.ასევე გასანბაჟებლად შეიძლება ჩაითვალოს კომერციული სახის ტვირთი,რომელშიც ითვლება ერთი სახეობის რამდენიმე ნივთი(მაგ:5 ერთნაირი ფეხსაცმელი,ბიჟუტერია და ა.შ.).განბაჟება ხდება თვენს მიერ მოწოდებული ინვოისის საფუძველზე.გთხვოთ გასანბაჟებელი საქონლის ინვოისები გადმოიგზავნოთ წინასწარ info@tsexpress.ge</p>\r\n'),
(22, 'კონტაქტი', 6, 1, '<p>საქართველო,თბილისი</p>\r\n\r\n<p>ქავთარაძის ქ.27</p>\r\n\r\n<p><img src="http://tsexpress.ge/images/facebook56.svg" style="height:13px" /> facebook.com/tsexpress.ge</p>\r\n\r\n<p>&nbsp;(032) 219 22 42&nbsp;</p>\r\n\r\n<p>&nbsp;info@tsexpress.ge</p>\r\n\r\n<p>skype:tsexpress1</p>\r\n');
